import React from 'react';
//import App from '../App'
// import {cardData} from '../App'
import "./Photocard.scss"
import {Card} from 'semantic-ui-react';





function PhotoCard(props) {
  //console.log(props);
  console.log('PhotoCard.js -> %cphotocard-props:', 'color: red', props)
  return (
 <section>
    
<Card>
    
    <Card.Content>
      <Card.Header>{props.name}</Card.Header>
     
      
     <ul>
     <p> `{props.name} is about {props.height} feet tall, give or take a few inches.`</p>
     <p> Hair: {props.hair} </p>
     <p> `Eyes are {props.eyes}, in the right light. `</p>
     <p> 
         Near as we can tell, {props.name} was born or came into being on {props.birthYear}</p>
  
     </ul>
  </Card.Content>
  
  
  </Card>
  {/* <Pagination>
  boundaryRange={1}
  defaultActivePage={props[0]}
  ellipsisItem={10}
  firstItem={props[0]}
  lastItem={props[10]}
  siblingRange={1}
  totalPages={10}
  </Pagination> */}

</section>
   
  )

  }
export default PhotoCard;
